import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import DoctorList from './components/DoctorList';
import BookingForm from './components/BookingForm';

function App() {
  return (
    <div className="App">
      <Navbar />
      <h1>Book a Doctor</h1>
      <DoctorList />
      <BookingForm />
    </div>
  );
}

export default App;
